import React from "react";
import { Route, Redirect } from "react-router-dom";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import EmailLogIn from "../pages/auth/Email Log In Page/EmailLogIn";

const PrivateRoute = ({ component: Component, auth, ...rest}) => {

    const signInWrapper = ({ children, currentUser }) => {
        return currentUser ? <Redirect to="/" replace /> : children;
    }
    <Route
    path="/signIn"
    element={<signInWrapper currentUser={this.props.currentUser}>
        <EmailLogIn/>
        </signInWrapper>}
    />
};

PrivateRoute.propTypes = {
    auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
    auth: state.auth
});

export default connect(mapStateToProps)(PrivateRoute);
